import React from 'react';
import { Link } from 'react-router-dom';

const Women = () => {
  const collections = [
    {
      title: 'Bestselling',
      image: 'https://images.unsplash.com/photo-1543163521-1bf539c55dd2?w=400&h=300&fit=crop',
      link: '/shop?category=women&type=bestselling'
    },
    {
      title: 'Trending',
      image: 'https://images.unsplash.com/photo-1515347619252-60a4bf4fff4f?w=400&h=300&fit=crop',
      link: '/shop?category=women&type=trending'
    },
    {
      title: 'Latest Collection',
      image: 'https://images.unsplash.com/photo-1551107696-a4b0c5a0d9a2?w=400&h=300&fit=crop',
      link: '/shop?category=women&type=latest'
    },
    {
      title: 'Heels',
      image: 'https://images.unsplash.com/photo-1535043934128-cf0b28d52f95?w=400&h=300&fit=crop',
      link: '/shop?category=women&type=heels'
    },
    {
      title: 'Flats',
      image: 'https://images.unsplash.com/photo-1603808033192-082d6919d3e1?w=400&h=300&fit=crop',
      link: '/shop?category=women&type=flats'
    },
    {
      title: 'Boots',
      image: 'https://images.unsplash.com/photo-1544966503-7cc5ac882d5f?w=400&h=300&fit=crop',
      link: '/shop?category=women&type=boots'
    }
  ];

  return (
    <div className="container mx-auto px-4 py-8">
      <div className="text-center mb-12">
        <h1 className="text-4xl font-bold text-main mb-4">Women's Collection</h1>
        <p className="text-secondary">Elegant footwear for women</p>
      </div>

      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
        {collections.map((collection, index) => (
          <Link 
            key={index}
            to={collection.link}
            className="group relative overflow-hidden rounded-lg shadow-lg hover:shadow-xl transition-all duration-300"
          >
            <div className="aspect-w-16 aspect-h-12">
              <img 
                src={collection.image} 
                alt={collection.title}
                className="w-full h-64 object-cover group-hover:scale-105 transition-transform duration-300"
              />
            </div>
            <div className="absolute inset-0 bg-black bg-opacity-40 group-hover:bg-opacity-50 transition-all duration-300"></div>
            <div className="absolute inset-0 flex items-center justify-center">
              <h3 className="text-white text-2xl font-bold text-center">{collection.title}</h3>
            </div>
          </Link>
        ))}
      </div>
    </div>
  );
};

export default Women;
